export class BoundingBox {
  minLatitude;
  minLongitude;
  maxLatitude;
  maxLongitude;
  constructor(minLatitude, maxLatitude, minLongitude, maxLongitude) {
    this.checkLatitude(minLatitude);
    this.checkLatitude(maxLatitude);
    this.checkLongitude(minLongitude);
    this.checkLongitude(maxLongitude);
    this.minLatitude = minLatitude;
    this.minLongitude = minLongitude;
    this.maxLatitude = maxLatitude;
    this.maxLongitude = maxLongitude;
  }
  checkLatitude(lat) {
    if (lat < -90 || lat > 90) throw new Error(`Illegal latitude ${lat}. Must be within [-90, 90]`);
  }
  checkLongitude(lon) {
    if (lon < -180 || lon > 180) throw new Error(`Illegal longitude ${lon}. Must be within [-180, 180]`);
  }
}
